import { NavBar } from "./component/NavBar";
import Home from "./component/Home";
import About from "./component/About";
import Skills from "./component/Skills";
import "./style/styles.css";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div>
        <NavBar/>
        <Home/>
        <About/>
        <Skills/>
      </div>
    </BrowserRouter>
  );
}

export default App;
